import logo from './logo.svg';
import './App.css';

function Feature(){
	return (
		<div>
		<header className="App-header">
		<h1>Day la test 1</h1>
		<img src={logo} className="App-logo" alt="logo" />
		<p>
			Edit <code>src/App.js</code> and save to reload. <br/>
			ababss
		</p>
		<a
			className="App-link"
			href="https://reactjs.org"
			target="_blank"
			rel="noopener noreferrer"
		>
			Learn React
		</a>
		</header>
		</div>
	)
}

function App() {
	return (
	<div>
		{/* <Feature></Feature> */}
		<YoutubeItem image="https://plus.unsplash.com/premium_photo-1673529873151-31306ec72ffb?q=80&w=1770&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
		avatar = "https://images.unsplash.com/photo-1495231916356-a86217efff12?q=80&w=1936&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"></YoutubeItem>

	</div>
	);
}

function YoutubeItem(props) {
	console.log(props);
	return (
		<div className="youtube-item">
			<div className="youtube-image">
				<img src={props.image} alt="" />
			</div>

			<div className="youtube-footer">
				<img src= {props.avatar}
				alt="" 
				className="youtube-avatar" />

				<div className="youtube-info">
					<h3 className="youtube-title"> {props.title} </h3>
					<h4 className="youtube-author">  </h4>
				</div>
			</div>
		</div>
	)
}

export default App;
